import React from "react";
import Navbar from "react-bootstrap/Navbar";
import PropTypes from "prop-types";

const Navbarcustom = ({ icon, title }) => {
  return (
    <Navbar 
      expand="lg"
      style={{
        backgroundColor: "#FFFFFF",
        boxShadow: "1px 1px 7px #002147",
        top: 0,
        left: 0,
        right: 0,
        padding: '0.3rem 1rem', // Reduced padding to decrease height
      }}
    >
      <Navbar.Brand href="#home" style={{ fontSize: "1rem", color: "black" }}>
        <i style={{ fontSize: "1.5rem", color: "black" }} className={icon}></i>
        {title}
      </Navbar.Brand>

      <form className="form-inline">
        <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
        <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
      </form>

      {/* Assuming the 'View Pins' and 'View Weather' buttons might go here. */}

    </Navbar>
  );
};

Navbarcustom.propTypes = {
  title: PropTypes.string.isRequired,
  icon: PropTypes.string,
};

Navbarcustom.defaultProps = {
  title: "Navbar",
  icon: "fas fa-id-card-alt",
};

export default Navbarcustom;
